import React, { Component } from "react";
import Parks from "./parks.json";
//import Park from "./parks.js";

class Home extends Component {
  constructor() {
    super();
    let name = Parks[0].name;
  }
  render() {
    return (
      <div>
        <h1>{name}</h1>
        <p>See all of the wildlife here! cons</p>
      </div>
    );
  }
}

export default Home;
